import './VideoPlayer.scss';
import { ApiKey } from '../../apiKey'

export default function VideoPlayer({data}){
	const apiVideo = data.video + '/' + ApiKey
	return(
			<article className='video'>
				<video  className='video__player' controls='true' poster={data.image} id={data.id}>
					<source  className='video__source' src={'https://www.youtube.com/watch?v=CfPxlb8-ZQ0'} type='video/mp4' />
				</video>
			</article>

	);
}
